    false,nt"url": null,nt"notes": "This data set contains the number of days
    of snow cover in days per year, and three 10-day snow depth means per month in centimeters
    from stations across Estonia. The days of snow cover data extend from 1891 through
    1994, while the snow depth means extend from 1891 through 1990. Some stations for
    some years have two data entries, one for a protected collection area, and one for
    an exposed collection area. Jaak Jaagus of the University of Tartu in Estonia contributed
    these data to the National Snow and Ice Data Center. Data are available via ftp.",nt"license_title":
